import logo from "./assets/logo.svg";
import moon from './assets/Moon_fill.svg';
function App() {
  return (
    <div className="bg-white-20 h-[100dvh]">
      <div className="h-[8dvh] pt-4 pb-4 pl-16 pr-16  border-solid border-b-[2px] border-white-30 flex flex-row justify-between items-center">
        <img src={logo} className="w-[180px] aspect-[3/1]"/>

        <div className="border-solid border-[2px] border-white-30 rounded-lg h-[40px] w-[40px] flex flex-col items-center justify-center">
          <img src={moon} className="aspect-square w-[30px]"/>
        </div>
      </div>

      <div className="h-[92dvh] flex flex-col items-center justify-center">
        <div className="bg-white-0 w-[20vh] h-[250px]"></div>
      </div>
    </div>
  );
}

export default App;
